class Solution {
    func minimumBeautifulSubstrings(_ s: String) -> Int {
        var dp = [Int](repeating: -1, count: s.count)
        let sArray = Array(s)

        func isPowerOfFive(_ val: Int) -> Bool {
            var val = val
            while val % 5 == 0 && val > 0 {
                val /= 5
            }
            return val == 1
        }

        func dfs(_ index: Int) -> Int {
            if index == s.count { return 0 }
            if dp[index] != -1 { return dp[index] }
            var ans = Int.max
            var num = 0
            for i in index..<s.count {
                num = num * 2 + Int(String(sArray[i]))!
                if sArray[i] == "0" && num == 0 { break }
                if isPowerOfFive(num) {
                    let next = dfs(i + 1)
                    if next != Int.max {
                        ans = min(ans, 1 + next)
                    }
                }
            }
            dp[index] = ans
            return ans
        }

        let result = dfs(0)
        return result == Int.max ? -1 : result
    }
}
